import React from 'react';
import { Button, Form, Col } from 'react-bootstrap';

const HomePage = () => {
  return (
  <>
  <div id="home-title">The 302</div>
  <h2>Helping you <b>find</b> solutions and ideas.</h2>
  <h3>The 302 is a tech blog curated by experts to deliver news and opinions on the latest tech.</h3>

  <div id="center">
    <Form inline>
    <Form.Row className="align-items-center">
        <Form.Group controlId="formEmail">
          <Col>
          <Form.Control size="sm" type="email" placeholder="Enter email address" />
          </Col>
        </Form.Group>
        <Button variant="success" type="submit">Subscribe</Button>
      </Form.Row>
    </Form>
  </div>
  </>
);
};

export default HomePage;
